import{_ as e,c as a,o as t,ah as r}from"./chunks/framework.C_cZWXvK.js";const h=JSON.parse('{"title":"快速了解","description":"","frontmatter":{"title":"快速了解","icon":"circle-info","index":true,"category":["入门基础"],"tags":["基础","入门","Android","Windows"]},"headers":[],"relativePath":"Know.md","filePath":"Know.md","lastUpdated":1746258574000}'),d={name:"Know.md"};function i(l,o,c,n,s,p){return t(),a("div",null,o[0]||(o[0]=[r('<div class="tip custom-block"><p class="custom-block-title custom-block-title-default">TIP</p><blockquote><p>苏柚是一款闭源软件，其分发遵循 <a href="https://gitcode.com/OutOfMemories-WorkGroup/F2DLPRL" target="_blank" rel="noreferrer">F2DLPRL</a>，使用者需遵守相关规定。<br> 苏柚旨在通过普通/adb/root权限全面覆盖各类 Android 设备，提升用户体验。<br> 其两个第一方开源依赖 <a href="https://gitcode.com/OutOfMemories-WorkGroup/FVV" target="_blank" rel="noreferrer">FVV</a> 和 <a href="https://gitcode.com/OutOfMemories-WorkGroup/NGA-SDK" target="_blank" rel="noreferrer">NGA SDK</a> 可供感兴趣的用户查看。</p></blockquote><p>如果你想要解锁苏柚的高阶玩法，请务必了解FVV文本格式哦！</p></div><h2 id="支持范围" tabindex="-1">支持范围 <a class="header-anchor" href="#支持范围" aria-label="Permalink to “支持范围”">​</a></h2><h3 id="android" tabindex="-1">Android <a class="header-anchor" href="#android" aria-label="Permalink to “Android”">​</a></h3><ul><li>系统为<code>Android 7.0+</code></li><li>架构为<code>arm64-v8a</code>、<code>x86_64</code>、<code>armeabi-v7a</code>之一</li></ul><h4 id="root实现" tabindex="-1">Root实现 <a class="header-anchor" href="#root实现" aria-label="Permalink to “Root实现”">​</a></h4><p><strong>如果你是<code>user</code>/<code>adb(shell)</code>用户，请忽略该内容</strong></p><p>常规的Root实现方式基本上都是支持的：</p><ul><li><code>Magisk</code>及其修改版本</li><li><code>KernelSU</code>及其修改版本</li><li><code>APatch</code>及其修改版本</li></ul><p>但对其他Root实现的支持持保留态度（？）（例如<code>Mumu模拟器</code>的自带Root是不支持的！）</p><p>但是以下Root实现不建议使用：</p><ul><li><code>Kitsune Magisk</code> (原<code>Magisk Delta</code>)，原因：不再更新，不支持新特性</li><li><code>SukiSU Ultra</code>，原因：<strong>实现有问题，影响正常使用</strong>，且开发者抵触此Root实现</li></ul><p><strong>强烈建议使用不建议的Root实现的用户尽快切换到其他Root实现！否则可能无法正常使用苏柚哦！</strong></p><h3 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to “Windows”">​</a></h3><ul><li>系统为<code>Windows 10+</code></li><li>架构为<code>x86_64</code></li></ul><h4 id="硬件需求" tabindex="-1">硬件需求 <a class="header-anchor" href="#硬件需求" aria-label="Permalink to “硬件需求”">​</a></h4><p>使用苏柚需要满足以下硬件需求：</p><ul><li>支持传输数据的<code>USB-A</code>或<code>USB-C</code>的接口（用于与Android设备交互）</li></ul><div class="warning custom-block"><p class="custom-block-title custom-block-title-default">WARNING</p><p>苏柚目前还在进行<strong>非正式版</strong>更新，功能可能出现<strong>不稳定</strong>、<strong>不完整</strong>情况，请见谅！</p></div>',18)]))}const m=e(d,[["render",i]]);export{h as __pageData,m as default};
